var nickname = prompt("  :");
var ws = new WebSocket("ws://localhost:7070");
var messagesDiv = document.getElementById("messages");
var userListUl = document.getElementById("user-list");
var messageInput = document.getElementById("message-input");
var sendButton = document.getElementById("send-button");
var myNickName = null;
ws.onopen = function () {
  ws.send(JSON.stringify({
    type: "set_nickname",
    nickname: nickname
  }));
};
ws.onmessage = function (event) {
  var data = JSON.parse(event.data);
  switch (data.type) {
    case "user-list":
      userListUl.innerHTML = "";
      data.users.forEach(function (user) {
        var li = document.createElement("li");
        li.textContent = user;
        userListUl.appendChild(li);
      });
      break;
    case "nickname_error":
      alert(data.message);
      window.location.reload();
      break;
    case "nickname_accepted":
      myNickName = data.nickname;
      break;
    case "message_history":
      data.messages.forEach(function (message) {
        var messageDiv = document.createElement("div");
        messageDiv.className = "message ".concat(message.sender === myNickName ? "right" : "");
        messageDiv.innerHTML = createMessage(message);
        messagesDiv.appendChild(messageDiv);
      });
      messagesDiv.scrollTop = messagesDiv.scrollHeight;
      break;
    case "new_message":
      console.log("New message received:", data);

      // eslint-disable-next-line no-case-declarations
      var messageDiv = document.createElement("div");
      messageDiv.className = "message ".concat(data.sender === myNickName ? "right" : "");
      messageDiv.innerHTML = createMessage(data);
      messagesDiv.appendChild(messageDiv);
      messagesDiv.scrollTop = messagesDiv.scrollHeight;
      break;
  }
};
sendButton.addEventListener("click", function () {
  var message = messageInput.value.trim();
  if (message) {
    ws.send(JSON.stringify({
      type: "send_message",
      content: message
    }));
    messageInput.value = "";
  }
});
document.addEventListener("keyup", function (e) {
  if (e.code === "Enter" && messageInput.value) {
    sendMessage();
  }
});
function createMessage(message) {
  return "\n\t\t\t\t\t<span class=\"message-sender\">".concat(message.sender === myNickName ? "You, " : message.sender + ", ").concat(message.timestamp, "</span>\n\t\t\t\t\t<span class=\"message-content\">").concat(message.content, "</span>\t\t\t\t\t\n\t\t\t\t");
}
function sendMessage() {
  var message = messageInput.value.trim();
  if (message) {
    ws.send(JSON.stringify({
      type: "send_message",
      content: message
    }));
    messageInput.value = "";
  }
}
